// resolve the "Cannot find name 'google'" error
// declare the google namespace to make TypeScript aware of the Google Maps global object

declare namespace google {
    export namespace maps {
      export class Map {}
      export class Geocoder {}
      export enum GeocoderStatus {
        OK = 'OK',
      }
      export interface GeocoderResult {
        geometry: {
          location: {
            lat: () => number;
            lng: () => number;
          };
        };
      }
      export interface MapOptions {
        center: {
          lat: number;
          lng: number;
        };
        zoom: number;
      }
    }
  }
